import React from 'react';
import {Route, Redirect} from 'react-router-dom';

export const ProtectedRoute = ({ details, path, component: Component }) => (
    <Route
      path={path}
      render={props => (
        details ? 
        <Component {...props} /> :
        <Redirect to='/' />
      )}
    />
  );
